import React from "react";
import "./App.css";
import { Button } from "bootstrap/dist/js/bootstrap.bundle";
import { Fragment, useState } from "react/cjs/react.production.min";
import { Routes, Route, Navigate } from "react-router-dom";
import NavBar from "./components/NavBar/NavBar";
import ContactList from "./components/contacts/ContactList/ContactList";
import AddContact from "./components/contacts/AddContact/AddContact";
import ViewContact from "./components/contacts/ViewContact/ViewContact";
import EditContact from "./components/contacts/EditContact/EditContact";
import RegisterPage from "./components/contacts/Home/RegisterPage";

const App = () => {
  const [userEmail, userPassword] = useState([]);
  const submitHandler = (uEmail, uPassword) => {};
  return (
    <Fragment>
      <NavBar />
      <Routes>
        <Route
          path={"/"}
          element={<Navigate to={"/contacts/RegisterPage"} />}
        />
        <Route
          path={"/contacts/RegisterPage"}
          element={<RegisterPage onLogin={submitHandler} />}
        />
        <Route path={"/"} element={<Navigate to={"/contacts/list"} />} />
        <Route path={"/contacts/list"} element={<ContactList />} />
        <Route path={"/contacts/add"} element={<AddContact />} />
        <Route path={"/contacts/view/:contactId"} element={<ViewContact />} />
        <Route path={"/contacts/edit/:contactId"} element={<EditContact />} />
      </Routes>
    </Fragment>
  );
};

export default App;
